// client/src/components/UploadedFile.js
import React from 'react';

const UploadedFile = ({ file }) => {
  if (!file) {
    return null;
  }

  const { originalname, size, mimetype, base64Data } = file;

  return (
    <div>
      <h2>Uploaded File</h2>
      <p>File Name: {originalname}</p>
      <p>File Size: {size} bytes</p>
      <p>File Type: {mimetype}</p>
      <p>Base64 Data: {base64Data}</p> {/* Display the base64 data for verification */}
    </div>
  );
};

export default UploadedFile;
